import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and fill search input
    await page.waitForSelector('#searchInput');
    await page.fill('#searchInput', 'iPhone');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_filled.png'));

    // Click search button
    await page.click('.search-btn');
    await page.waitForLoadState('networkidle');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_clicked.png'));

    // Wait for search results to load
    await page.waitForSelector('.search-results, .products-grid, .products-list', { timeout: 5000 });
    await page.waitForTimeout(1000); // Additional wait for results to render
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_results_loaded.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_results_loaded.png'));

    // Extract search results data
    const extractedData = {
      resultCount: await page.evaluate(() => {
        const countEl = document.querySelector('.results-count');
        return countEl ? countEl.textContent.trim() : 'Unknown';
      }),
      products: await page.evaluate(() => {
        const products = [];
        const productElements = document.querySelectorAll('.product-card, .product-card-list');

        productElements.forEach((product, index) => {
          if (index < 5) { // Limit to first 5 products
            const title = product.querySelector('.product-title')?.textContent.trim() || 'No title';
            const price = product.querySelector('.product-price')?.textContent.trim() || 'No price';
            products.push({ title, price });
          }
        });

        return products;
      })
    };

    return {
      success: true,
      action: "Searched for 'iPhone' products and extracted search results",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to search for 'iPhone' products",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
